import React, { Component } from "react";
import ButtonGroup from "react-bootstrap/ButtonGroup";
import Button from "react-bootstrap/Button";
import ToggleButton from "react-bootstrap/ToggleButton";
import './icons.css';

class DirectionsPicker extends Component {
  render() {




    
    return (

    <div>
        <h4>Directions specifications</h4>
      <ButtonGroup aria-label="Basic example">
        <Button checked={true} type="radio" variant="secondary"><i class="material-icons">directions_bus</i></Button>
        <ToggleButton type="radio" variant="secondary"><i class="material-icons">directions_bike</i></ToggleButton>
        <ToggleButton type="radio" variant="secondary"><i class="material-icons">directions_car</i></ToggleButton>
        <ToggleButton type="radio" variant="secondary"><i class="material-icons">directions_walk</i></ToggleButton>
      </ButtonGroup>

      </div>
    );
  }
}

export default DirectionsPicker;
